- input: "TEXT\x1CC00039503\x1C2\x1C\x1CF3XA\x1CThis report is being amended in response
    to a Request for Additional Information from the Commission, dated July 7, 2010.
    \ The original report, filed using the FEC software, appeared to have dropped
    the receipts disclosed in February from the aggregate year-to-date totals disclosed
    on the Summary and Detailed Summary Pages of the report and caused a gap between
    the ending balance of the previous report and the beginning balance of this one.
    \ This amendment corrects all issues raised. Additionally, the omission by the
    FEC software affected the itemization of individuals on Schedule A supporting
    Line 11ai; therefore, this amendment also disclose additional contributions on
    Schedule A.  Please note that these errors appear to be related to the FECfile
    software and were not intentional.  Future reports will be filed by our new vendor,
    and we have taken steps to prevent such errors in the future.  Please update your
    records accordingly.\n"
